import React, { useState, useEffect } from 'react';
import axios from 'axios';


function KontaktdatenComponent() {

  const [data, setData] = useState('');
 
  
  useEffect(() => {
    fetchDataByAxios();
  },[]);

  let access_token =
    "Bearer sBjkUkoIC5ElWirx0AOxRCe4c_O0wGr0z7W6yyC7yOI.z9UC4nONFJQXsiM6y0kiFDKN53p7qz5MtRDKHaRzvGw";

  const fetchDataByAxios = async () => {
    let response = await axios({
      mehtod: "GET",
      url: "/5004333890/kontaktdaten",
      mode: "no-cors",
      headers: {
        "Access-Control-Allow-Origin": "*",
        "Authorization": access_token,
        "Content-Type": "application/json",
        // "Content-Type": "application/x-www-form-urlencoded",
      },
    })
      .then((response) => {
        console.log(response);
        const allData = response.data;
        setData(allData);
        console.log(allData);
      })
      .catch((error) => console.error(`Error:${error}`));
    console.log(window.location.href)
  };


  // 'Content-Type': 'application/json',
  // baseURL: 'https://mitarbeiterwebservice.maklerinfo.biz/service/ari/employee/1.0/rest/Alpha0_BQ5G3X/kunden'

  return (
    <div>
    
      <div>
        {
          data ? (
            
            data.map((data) => {
              return (
                <div
                  key={data.Id}
                  className="container d-flex justify-content-center align-items-center"
                >
                  <div className="card">
                    <div className="upper">
                      <img
                        src="https://i.imgur.com/Qtrsrk5.jpg"
                        className="img-fluid"
                        alt="holle test"
                      />
                    </div>

                    <div className="user text-center">
                      <div className="profile">
                        <img
                          src="https://i.imgur.com/JgYD2nQ.jpg"
                          className="rounded-circle"
                          width="80"
                          alt="holle test"
                        />
                      </div>
                    </div>
                  </div>
                </div>
              );})
            ) : (<h3>No data yet</h3>)
        }
      </div>


    </div>

  );
}
export default KontaktdatenComponent;

